package com.entity;

public class MechanicDtls {
	
	private int id;
	private String name;
	private String email;
	private String mobile1;
	private String mobile2;
	private String password;
	private String area;
	private String exprience;
	private String govt_id;
	private String Specialist;
	private String status;
	private String  profile;
	private String map;
	
	public MechanicDtls() {
		super();
		// TODO Auto-generated constructor stub
	}
    

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getEmail() {
		return email;
	}

	public void setEmail(String email) {
		this.email = email;
	}

	 
	public String getMobile1() {
		return mobile1;
	}


	public void setMobile1(String mobile1) {
		this.mobile1 = mobile1;
	}


	public String getMobile2() {
		return mobile2;
	}


	public void setMobile2(String mobile2) {
		this.mobile2 = mobile2;
	}


	public String getPassword() {
		return password;
	}

	public void setPassword(String password) {
		this.password = password;
	}

	public String getArea() {
		return area;
	}

	public void setArea(String area) {
		this.area = area;
	}

	public String getExprience() {
		return exprience;
	}

	public void setExprience(String exprience) {
		this.exprience = exprience;
	}

 

	
	public String getGovt_id() {
		return govt_id;
	}


	public void setGovt_id(String govt_id) {
		this.govt_id = govt_id;
	}


	public String getSpecialist() {
		return Specialist;
	}

 

	public void setSpecialist(String specialist) {
		Specialist = specialist;
	}




	public String getStatus() {
		return status;
	}




	public void setStatus(String status) {
		this.status = status;
	}
 
	 


	public String getProfile() {
		return profile;
	}


	public void setProfile(String profile) {
		this.profile = profile;
	}


	public String getMap() {
		return map;
	}


	public void setMap(String map) {
		this.map = map;
	}


	@Override
	public String toString() {
		return "MechanicDtls [id=" + id + ", name=" + name + ", email=" + email + ", mobile1=" + mobile1 + ", mobile2="
				+ mobile2 + ", password=" + password + ", area=" + area + ", exprience=" + exprience + ", govt_id="
				+ govt_id + ", Specialist=" + Specialist + ", status=" + status + ", profile=" + profile + ", map="
				+ map + "]";
	}


	 

	  
}
